client_script:
frappe.web_form.on('resume_link', (field, value) => {
    if (!frappe.utils.is_url(value)) {
        frappe.msgprint(__('Resume link not valid'));
    }
});

frappe.web_form.after_load = () => {
    if (window.location.pathname.endsWith("/new") && frappe.session.user) {
        let current_path = window.location.href;
        window.location.href = current_path.replace("/new", "/" + frappe.session.user);
    }
}

frappe.ui.form.on('taq_data1', {
    refresh: function(frm) {
        //     
        $('body').css({
            'background': 'linear-gradient(135deg, #f0f4f8 0%, #e8ecf3 100%)',
            'font-family': '"Poppins", "Segoe UI", sans-serif',
            'transition': 'background 0.6s ease'
        });

        //     
        $('.form-layout').css({
            'background': '#ffffff',
            'border-radius': '16px',
            'box-shadow': '0 8px 25px rgba(0, 0, 0, 0.08)',
            'padding': '25px',
            'transition': 'all 0.3s ease-in-out'
        });

        //    
        $('.form-section .section-head, .form-grid .grid-heading-row').css({
            'color': '#333',
            'font-weight': '600',
            'font-size': '1.1rem',
            'border-left': '4px solid #3B82F6',
            'padding-left': '8px',
            'margin-bottom': '8px'
        });

        //     
        $('.primary-action').css({
            'background': 'linear-gradient(90deg, #3B82F6, #06B6D4)',
            'border': 'none',
            'border-radius': '8px',
            'color': '#fff',
            'font-weight': '600',
            'padding': '10px 20px',
            'box-shadow': '0 3px 8px rgba(59, 130, 246, 0.3)',
            'transition': 'all 0.3s ease'
        }).hover(function() {
            $(this).css('transform', 'scale(1.05)');
        }, function() {
            $(this).css('transform', 'scale(1)');
        });

        //     
        $('input, select, textarea').css({
            'border-radius': '8px',
            'border': '1px solid #d1d5db',
            'padding': '8px 10px',
            'transition': 'border-color 0.3s ease, box-shadow 0.3s ease'
        }).focus(function() {
            $(this).css({
                'border-color': '#3B82F6',
                'box-shadow': '0 0 6px rgba(59, 130, 246, 0.4)'
            });
        }).blur(function() {
            $(this).css({
                'border-color': '#d1d5db',
                'box-shadow': 'none'
            });
        });
    }
});
